import React from "react";
import Card from "./Card";
import Sdata from "./Sdata";

const FavSeries = "Netfli";

const FavS = () => {
  if (FavSeries === "Netflix") {
    return (
      <Card
        key={Sdata[2].id}
        imgsrc={Sdata[2].imgsrc}
        title={Sdata[2].title}
        sname={Sdata[2].sname}
        links={Sdata[2].links}
      />
    );
  } else {
    <Card
      key={Sdata[3].id}
      imgsrc={Sdata[3].imgsrc}
      title={Sdata[3].title}
      sname={Sdata[3].sname}
      links={Sdata[3].links}
    />;
  }
};

const Netflix = () => {
  return (
    <>
      <h1 className="heading-style">List of TOP Most Webseries in Netflix</h1>
      <FavS />
      {/* {Sdata.map((val) => {
        return (
          <Card
            key={val.id}
            imgsrc={val.imgsrc}
            title={val.title}
            sname={val.sname}
            links={val.links}
          />
        );
      })} */}
    </>
  );
};

export default Netflix;
